import React from 'react';

class FormDemo extends React.Component{

    constructor(props){
        super(props);
        this.state = {value:''};
    }

    handleChange(evt){
        this.setState({value: evt.target.value})
    }
    render(){
        return(
            <form>
                <label>
                    User name:
                </label>
                <input type="text">
                </input>
                <input type="submit"></input>
            </form>
        );
    }
}

export default FormDemo;
